import React from "react";
import CircleImg from "../atoms/CircleImg";
import CircleText from "../atoms/CircleText";

function CircleImgArea() {
  return (
    <div className="two-circle-image-area">
      <CircleImg />
      <CircleText />
    </div>
  );
}

export default CircleImgArea;
